import "../../css/command.css";
import portrait from "../../images/portrait.png";

const About = () => {
  return (
    <div className="command">
      <h3>About</h3>
      <img src={portrait} alt="self portrait" />
      <p>
        I am an aspiring software developer looking for a job that i dont hate
        so i dont have to work in the restaurant industry anymore please hire me
        thank you
      </p>
      {/* prettier-ignore */}

      <pre>

      </pre>
    </div>
  );
};

export default About;
